import React from 'react'
const Card = (props) => {
  return (

    
      <div className="col-4">
        <div className='text-center' pt>
        <img
          className='netizen-card-img '
          src={props.image}
          alt=""
          
        />
        </div>
        <h2 className='text-center'>
          {props.title}
        </h2>
        <p className='text-center'>
          {props.soustitle}
        </p>
        <h6 className='text-center'>{props.signature}</h6>

      </div>
    




  )
}

export default Card
